INSERT INTO `EmailTemplates` (`id`, `templateName`, `templateHeader`, `templateSubject`, `templateBody`, `templateFor`, `status`, `createdAt`, `updatedAt`) VALUES
(1, 'user Welcome Email', 'Welcome to Welrm  ', 'Welcome to Welrm  ', '<div style=\"background:#f8f8f8; color:#514d6a; font-family:arial; line-height:28px; padding:0px 0px; width:100%\">\n<div style=\"display:block; font-size:14px; margin-bottom:0px; margin-left:auto; margin-right:auto; margin-top:0px; max-width:700px; padding:50px 0\">\n<div style=\"display:block; font-size:14px; margin-bottom:0px; margin-left:auto; margin-right:auto; margin-top:0px; max-width:700px; padding:50px 0\">\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"background-color:#ffffff; width:100%\">\n	<tbody>\n		<tr>\n			<td style=\"text-align:center; vertical-align:top\">\n			<div style=\"padding:25px 25px 0px\"><a href=\"[SITE_LINK]\" target=\"_blank\"><img alt=\"Welrm Logo\" src=\"site-logo.png\" style=\"border:none; width:150px\" /> </a></div>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<div style=\"background:#ffffff; padding:25px\">\n<div style=\"color:#000000; font-size:18px; font-weight:bold; margin-bottom:10px; margin-left:0px; margin-right:0px; margin-top:10px\">Dear [NAME],</div>\n\n<div style=\"color:#000000; font-size:16px; line-height:22px; margin-bottom:12px; margin-top:12px\">Thank you for registering with Welrm.<br />\nTo login into your account please use the password given below:</div>\n\n<div style=\"background:#e3e6fb; display:inline-block; float:left; font-size:14px; margin-top:10px; width:100% !important; word-break:break-all\">\n<div style=\"color:#000000; float:left; font-size:16px; line-height:24px; margin-top:0px; padding:10px 10px\">\n<!-- <div>Username : <strong>[USER_NAME]</strong></div> -->\n\n<div>Password : <strong>[PASSWORD]</strong></div>\n</div>\n</div>\n\n<!-- <div style=\"color:#000000; display:inline-block; font-size:16px; font-weight:600; line-height:28px; margin-top:20px\">Please click on the below button:</div>\n\n<div style=\"margin-top:5px\"><a href=\"[RESET_LINK]\" style=\"display: inline-block; padding: 7px 30px; margin: 5px 0px 5px; font-size: 15px; color: #fff; background: #1B2251; text-decoration:none;\">Login to Account</a></div>\n -->\n<div style=\"color:#000000; font-size:16px; line-height:20px; margin-top:60px\">\n	<!-- If the button above does not work, copy and paste the URL below in your browser. -->\n<div style=\"color:#1b2251; padding-top:20px; width:100%\">\n	 <b>Note:</b> This is a temporary password, please change your password after login.\n\n</div>\n</div>\n\n<div style=\"border-top:1px solid #1b2251; color:#000000; margin-top:30px; padding-top:20px; word-break:break-all\">\n<div style=\"font-size:15px; line-height:25px; margin-left:0px; margin-right:0px; margin-top:0px\">Thanks<br />\nWelrm Team</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 'welcome_email', 1, '2022-09-12 18:14:49', '2022-09-15 18:39:14'),
(2, 'Verification Email', 'Verification Email  ', 'Verify your Email', '	<div style=\"background:#f8f8f8; color:#514d6a; font-family:arial; line-height:28px; padding:0px 0px; width:100%\">\r\n<div style=\"display:block; font-size:14px; margin-bottom:0px; margin-left:auto; margin-right:auto; margin-top:0px; max-width:700px; padding:50px 0\">\r\n<div style=\"display:block; font-size:14px; margin-bottom:0px; margin-left:auto; margin-right:auto; margin-top:0px; max-width:700px; padding:50px 0\">\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"background-color:#ffffff; width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:top\">\r\n			<div style=\"padding:25px 25px 0px\"><a href=\"[SITE_LINK]\" target=\"_blank\"><img alt=\"Welrm Logo\" src=\"[SITE_LOGO]\" style=\"border:none; width:150px\" /> </a></div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<div style=\"background:#ffffff; padding:25px\">\r\n<div style=\"color:#000000; font-size:18px; font-weight:bold; margin-bottom:10px; margin-left:0px; margin-right:0px; margin-top:10px\">Dear {{NAME}},</div>\r\n\r\n<div style=\"color:#000000; font-size:16px; line-height:22px; margin-bottom:12px; margin-top:12px\">Thank you for registering with Welrm. To verify your email click on the button below:</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div style=\"margin-top:5px\"><a href=\"{{VERIFICATION_LINK}}\" style=\"display: inline-block; padding: 7px 30px; margin: 5px 0px 5px; font-size: 15px; color: #fff; background: #1B2251; text-decoration:none;\">Click here to verify your email&nbsp;</a></div>\r\n\r\n<div style=\"color:#000000; font-size:16px; line-height:20px; margin-top:30px\">If the button above does not work, copy and paste the URL below in your browser.\r\n<div style=\"color:#1b2251; padding-top:10px; width:100%\"><a href=\"{{VERIFICATION_LINK}}\" style=\"color:#1b2251;font-weight: 600;    text-decoration: underline;\">{{VERIFICATION_LINK}}</a></div>\r\n</div>\r\n\r\n<div style=\"border-top:1px solid #1b2251; color:#000000; margin-top:30px; padding-top:20px; word-break:break-all\">\r\n<div style=\"font-size:15px; line-height:25px; margin-left:0px; margin-right:0px; margin-top:0px\">Thanks<br />\r\nWelrm Team</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n', 'verification_email', 1, '2022-09-12 18:14:49', '2022-09-15 18:39:14'),
(3, 'Booking Details', 'Booking Details ', 'Booking Details', '	<div style=\"background:#f8f8f8; color:#514d6a; font-family:arial; line-height:28px; padding:0px 0px; width:100%\">\r\n		<div\r\n			style=\"display:block; font-size:14px; margin-bottom:0px; margin-left:auto; margin-right:auto; margin-top:0px; max-width:700px; padding:50px 0\">\r\n			<div\r\n				style=\"display:block; font-size:14px; margin-bottom:0px; margin-left:auto; margin-right:auto; margin-top:0px; max-width:700px; padding:50px 0\">\r\n				<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"background-color:#ffffff; width:100%\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"text-align:center; vertical-align:top\">\r\n								<div style=\"padding:25px 25px 0px\"><a href=\"[SITE_LINK]\" target=\"_blank\"><img\r\n											alt=\"WELRM Logo\" src=\"[SITE_LOGO]\" style=\"border:none; width:150px\" /> </a>\r\n								</div>\r\n							</td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n\r\n				<div style=\"background:#ffffff; padding:25px\">\r\n					<div\r\n						style=\"color:#000000; font-size:18px; font-weight:bold; margin-bottom:10px; margin-left:0px; margin-right:0px; margin-top:10px\">\r\n						Dear {{NAME}},</div>\r\n\r\n					<div style=\"color:#000000; font-size:16px; line-height:22px; margin-bottom:12px; margin-top:12px\">\r\n						Your Booking is Completed Successfully.</div>\r\n\r\n					<div\r\n						style=\"color:#000000; display:inline-block; font-size:16px; font-weight:600; line-height:28px; margin-top:10px\">\r\n						Here are the Booking details:</div>\r\n\r\n					<div\r\n						style=\"background:#e3e6fb; display:inline-block; margin-top:10px; width:100% !important; word-break:break-all\">\r\n						<div\r\n							style=\"color:#000000; float:left; font-size:16px; line-height:24px; margin-top:0px; padding:10px\">\r\n							<div>Hotel Name: <strong>{{HOTEL}}</strong></div>\r\n							<div>Room-type: &nbsp; <strong>{{ROOM_TYPE}}</strong></div>\r\n							<div>No. of Roo